import React from 'react';
import { OuterWrapper, InnerWrapperFooter, P, H2 } from 'styles/MainStyles';
import styled from 'styled-components'

const Footer = () => {

    return (
    <OuterWrapper>
        <InnerWrapperFooter>
        <FooterTitle>NEWS LETTER</FooterTitle>
        <FooterText>Would you like to receive our newsletter?</FooterText>
        <InputButtonWrapper>
        <label htmlFor='new-message'>
            <FooterInput
                type="input"
            //   onChange={onSetNameChange}
            //   value={newName}
              placeholder='Email'
              />
        </label>
            <SendButton type="submit">SEND</SendButton>
        </InputButtonWrapper>
        <P>LINKS</P>
        <P>Book a room</P>
        </InnerWrapperFooter>
    </OuterWrapper>
    )
}

export default Footer;

const FooterTitle = styled(H2)`
font-size: 18px;
margin-bottom: 0px;
font-weight:500;
`

const FooterText = styled(P)`
font-size: 14px;
text-align: center;
line-height: 20px;
`

const FooterInput = styled.input`
font-size: 14px;
text-align: center;
line-height: 20px;
`

const SendButton = styled.button`
font-size: 14px;
text-align: center;
line-height: 20px;
`

const InputButtonWrapper = styled.div`
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
    width: 100%;
`
